//router.js 引入路由
import Vue from 'vue';
import Router from 'vue-router'; //引入自定义组件
//import Home from './views/Home.vue'

import Home from "./components/Home.vue";
import MiddleBar from "./components/common/MiddleBar.vue";
import Login from "./components/primary/Login.vue";
import Index from "./components/primary/Index.vue";
import Product from "./components/primary/Product.vue";
import Cart from "./components/primary/Cart.vue";
import List from "./components/primary/List.vue";
import Center from "./components/primary/Center.vue";
import Details from "./components/primary/Details.vue";
import Reg from "./components/primary/Reg.vue";
Vue.use(Router); //4.为组件配置路径

export default new Router({
  routes: [{
    path: '/Home',
    component: Home,
    meta: {
      isLogin: false
    }
  }, {
    path: '/MiddleBar',
    component: MiddleBar
  }, {
    path: '/Login',
    component: Login,
    meta: {
      isLogin: false
    }
  }, {
    path: '/Index',
    component: Index,
    meta: {
      isLogin: false
    }
  }, {
    path: '/Cart',
    component: Cart,
    meta: {
      isLogin: true
    }
  }, {
    path: '/Product',
    component: Product,
    meta: {
      isLogin: false
    }
  }, {
    path: '/List',
    component: List,
    meta: {
      isLogin: false
    }
  }, {
    path: '/Center',
    component: Center,
    meta: {
      isLogin: false
    }
  }, {
    path: '/details',
    component: Details,
    meta: {
      isLogin: true
    }
  }, {
    path: '/Reg',
    component: Reg
  }]
});
